import React from "react";
export default class Home extends React.Component {
    constructor(){
        super();
        fetch("http://localhost:8000/api/home").then(async response=>{
            this.state = await response.json();;
        }).catch(err=>{
            console.error(err);
        });
    }
    
    componentDidMount(){
        fetch("http://localhost:8000/api/home").then(async response=>{
            const res = await response.json();
            this.setState(res);
        }).catch(err=>{
            console.error(err);
        });
    }
   
    componentDidUpdate(){
        console.log("updated");
        console.log(this.state);
    }
    render(){
        return(
            <div></div>
        )
    }
}
